    url: 'http://www.vvdailypress.com/news/20171003/apple-valley-man-arrested-after-attacking-elderly-couple-during-robbery-friday',
    host: 'vvdailypress.com',
    text: 'Apple Valley man arrested after attacking elderly couple during robbery Friday Tuesday Oct 3, 2017 at 5:45 PM Oct 3, 2017 at 5:45 PM Staff Reports \nAPPLE VALLEY — Authorities arrested a 46-year-old man accused of breaking into a home and attacking an elderly couple early Friday. \nAlbert Jermaine Johnson, of Apple Valley, was arrested following the incident, which occurred at a home in the 21000 block of Highway 18 Friday morning. \nSan Bernardino County Sheriff’s Department officials stated Tuesday that deputies were first dispatched to the home at 12:28 a.m. after receiving reports of a residential robbery in progress. \n“The adult male victim was awakened by the sound of breaking glass and when he got up to see where the noise was coming from he saw a black male, later identified as Albert Johnson, walking past the broken window,” sheriff’s officials said. \nJohnson allegedly attacked the couple after the victim told his wife to call 911, causing “significant injury” to both. Officials said he stopped the attack and then barricaded himself in a bedroom when he saw lights from a deputy’s patrol car. \n“Deputies entered the residence and forced entry into the bedroom where the suspect was hiding,” officials said. “After a brief struggle, the suspect was arrested without further incident.” \nThe victims were able to flee before the standoff, officials said, and were taken to St. Joseph Health, St. Mary for treatment of their injuries. Further updates on their condition weren’t available Tuesday. \nJohnson was arrested on suspicion of robbery, false imprisonment, and causing harm or death to an elder or dependent adult. He appeared in court Tuesday, where prosecutors charged him with second-degree robbery, with additional enhancements for using a deadly weapon and causing a grave bodily injury. \nJohnson plead not guilty to the charge Tuesday, as well as denying all enhancements, court records show. Prosecutors also set his bail at $400,000. Johnson remains in custody at the West Valley Detention Center. About Us',
