    host: 'homelandsecuritynewswire.com',
    text: 'White House plans to push rosy outlook for Puerto Rico as criticisms mount (Kyle Feldscher, Washington Examiner ) White House homeland security adviser Tom Bossert has developed a sunny plan for a public relations push on the federal response to Hurricane Maria in Puerto Rico, even as less than half of the island has access to clean drinking water. \nDisruptive by design: Why we’re not ready to fight agroterrorism (Ryan Larson, Signal ) The word “agroterrorism” is rarely used, and fortunately, an event is even more rare. Rarer still are common understanding and readiness among U.S. agencies facing this threat. However, recent legislation and a survey of the nation’s emergency management capabilities underscore the need to prepare even for low-probability but high-impact acts of agroterrorism. \nOrange County, California, is ICE ’s island of support in sanctuary state (Patrick Michels, Reveal ) From all outward signs, Orange County seems to be on the cusp of change. Yet Trump’s presidency also reinvigorated the county’s conservatives, who once again are leading the movement to increase deportations and override the state’s protections for people living in the U.S. illegally.',
