    url: 'http://www.thisismoney.co.uk/money/markets/article-4945550/Fidelity-drop-fixed-fees-actively-managed-funds.html',
    host: 'thisismoney.co.uk',
    text: 'Share this article Share Instead Fidelity will charge higher fees if a fund beats the wider industry – but lower ones if it doesn\'t. This means bosses\' pay packets will be bigger when they maximise returns for investors. A £7 TRILLION INDUSTRY £233billion Assets fund manager Fidelity looks after for investors 400 Funds that Fidelity has that invest in stock markets around the world 26m Savers who have ploughed money into Fidelity’s funds £7trillion Value of all the cash tied up in funds based in Britain 1.75 per cent What some are paying for fund bosses to manage their money £5,493 Fees you’d pay on £20,000 invested over ten years Existing Fidelity investors can switch their money to the new fee structure when it is introduced but have the option of sticking with the current system if they prefer. This, however, will lead to higher costs than if they switch, after European Union rules on charging for research come into force in January. Fidelity president Brian Conroy said: \'Across the world our industry is being questioned on the value it provides clients. \'We believe today is the time for the industry to make fundamental changes to charges.\' The fund manager hopes to begin introducing the system early next year, with extra details to be revealed in the coming months. Adrian Lowcock of investment firm Architas said: \'Performance fees mean investors are effectively charged more for a fund manager being good at their job.\' Rival Allianz Global Investors plans to introduce UK performance fees next year. Share or comment on this article Most watched Money videos',
