    text: 'Hong Kong Exchanges and Clearing Limited and The Stock Exchange of Hong Kong Limited take no responsibility for the contents of this document, make no representation as to its accuracy or completeness and expressly disclaim any liability whatsoever for any loss howsoever arising from or in reliance upon the whole or any part of the contents of this document.\nHSBC Holdings plc Overseas Regulatory Announcement The attached announcement has been released to the other stock exchanges on which HSBC Holdings plc is listed.\nThe Board of Directors of HSBC Holdings plc as at the date of this announcement are: Mark Tucker*, Stuart Gulliver, Phillip Ameen † , Kathleen Casey † , Laura Cha † , Henri de Castries † , Lord Evans of Weardale † , Joachim Faber † , Irene Lee † , John Lipsky † , Iain Mackay, Heidi Miller † , Marc Moses, David Nish † , Jonathan Symonds † , Jackson Tai † and Pauline van der Meer Mohr † .\n* Non-executive Group Chairman\n† Independent non-executive Director Hong Kong Stock Code: 5\nHSBC Holdings plc Registered Office and Group Head Office:\n8 Canada Square, London E14 5HQ, United Kingdom Web: www.hsbc.com\nIncorporated in England with limited liability. Registered in England: number 617987\nHSBC HOLDINGS PLC 3 October 2017 Transaction in own shares HSBC Holdings plc (the Company) announces that it has purchased for cancellation the following number of its ordinary shares of US$0.50 each on the London Stock Exchange from Credit Suisse Securities (Europe) Limited (Credit Suisse) as part of its buyback announced on 1 August 2017.\nDate of purchase:\n3 October 2017\nNumber of ordinary shares of US$0.50 each purchased:\n1,407,529\nHighest price paid per share:\n£7.4680\nLowest price paid per share:\n£7.4110\nVolume weighted average price paid per share:\n£7.4399\nFollowing the cancellation of the repurchased shares, the Company will have 20,386,352,861 ordinary shares in issue, including 325,273,407 ordinary shares which are held in treasury. Therefore the total voting rights in HSBC Holdings plc will be 20,061,079,454. This figure for the total number of voting rights may be used by shareholders as the denominator for the calculations by which they will determine if they are required to notify their interest in, or a change to their interest in, HSBC Holdings plc under the FCA\'s Disclosure Guidance and Transparency Rules.\nIn accordance with Article 5(1)(b) of Regulation (EU) No 596/2014 (the Market Abuse Regulation), a full breakdown of the individual trades is attached to this announcement.\nhttp://www.rns-pdf.londonstockexchange.com/rns/6136S_-2017-10-3.pdf\nThis announcement will also be available on HSBC\'s website at www.hsbc.com/sea\nEnquiries to:\nJJ Williams Shareholder Services\n+ 44 (0) 203 268 3568\nHSBC Holdings plc published this content on 04 October 2017 and is solely responsible for the information contained herein.\nDistributed by Public, unedited and unaltered, on 04 October 2017 00:54:03 UTC .\nOriginal document http://www.hsbc.com/-/media/hsbc-com/investorrelationsassets/stockexchangeannouncements/2017/october/sea-171003-e-transaction-in-own-shares-3-oct-2017.pdf\nPublic permalink http://www.publicnow.com/view/DF87B5B6A723B3991069035C2D259FE1E2DC2FC0',
