    url: 'http://www.impartialreporter.com/news/15563885.Denzil_McDaniel__Is_division_and_racism_born_in_you_or_does_it_happen_as_you_grow_up_/',
    host: 'impartialreporter.com',
    text: 'Denzil McDaniel: Is division and racism born in you or does it happen as you grow up? Denzil McDaniel: Is division and racism born in you or does it happen as you grow up? \n  \nIt’s a sort of chicken and egg question. As we grow up, is hatred of others inherent in us and we have to be taught to love people different to us? Or do we naturally love others, and are taught by circumstance or people around us to show bitterness towards the “other side”? Looking at division across the world, not least in our own country, it’s an interesting one and it comes to my mind particularly as I watch the “takeaknee” controversy in the United States which sees Donald Trump’s latest row when he lines up against sports stars protesting against treatment of black people. The tension of race hostility has been deep in the American psyche since the slavery days, and even in living memory it’s worth recalling the context of where we are now. Firstly, a couple of little nuggets of information about how different the backgrounds of the last two US presidents were. Donald Trump’s mother was originally from Scotland’s Isle of Lewis; she arrived in New York in 1930 penniless and got work as a domestic to get a better life for herself. Mary Anne MacLeod is exactly the sort of immigrant that her son would like to keep out of the country, but she stayed after marrying the wealthy Trump senior. Barack Obama’s mother was a white woman from Kansas and his father was originally from Kenya. They married in 1961. Interestingly, in that year there were still 17 states in America, particularly in the south where they wouldn’t have been able to get married because it was illegal for black and white people to marry. So by the time Mary Anne MacLeod Trump was enjoying a new life with her wealthy husband, Obama’s father’s black compatriots were far from enjoying civil rights. The black singer, dancer and actor Sammy Davis junior was a high profile figure in the 1960s, politically as well in the entertainment industry. He was valued by the John F Kennedy Presidential election campaign in 1960 and joined a host of celebrities at their Convention. But alone among the celebs, Davis was booed by Democratic delegates when he came on stage. His crime – was to marry a white woman. Remember the movie “Guess who’s coming to dinner” with Sidney Poitier? In more recent times, the issue of mixed marriage between Catholics and Protestants caused consternation in families here, and alone in these islands Northern Ireland still won’t countenance same-sex marriage. So, some issues recur through the ages. Yet in 1964, Sammy Davis junior predicted at a show that there were five-year-old boys in the audience who could grow up and in 40 years become the first Negro to become president. He was to be amazingly only four years out, so obviously America has come a long way. Or has it? In the times he said it, it was in itself a remarkable prediction. There are still images in my mind as a boy of seeing the Civil Rights campaign unfolding. The inspirational non-violence and history-making speeches of Martin Luther King and the grainy coverage of Governor George Wallace standing at the door of the University of Alabama to stop two black students enrolling in the all-white institution. JFK stepped in, federalised the National Guard and the names of the students Vivian Malone and James Hood went into the history books. Probably the most stark was the sight on television at the 1968 Olympics in Mexico City, when American sprinters Tommie Smith and John Carlos climbed on the medal podium, bowed their heads and raised a gloved clenched fist in a “black power” salute as the flag was raised to the sound of the Star-Spangled Banner. To many on this side of the Atlantic, it seemed a worrying development, an act of defiance which hinted at a more violent battle for civil rights. But for students Malone and Hood, for athletes Smith and Carlos, and indeed Muhammad Ali who threw his Olympic boxing medal into the river in disgust at his treatment as a black in his native Louisville, today we read of people like Colin Kaepernick. He’s the American footballer with the San Francisco 49ers who last year knelt on one knee while the national anthem was being played, saying: “I am not going to stand up to show pride in a flag for a country that oppresses black people and people of colour.” Trump has his own inimitable way of responding, with a foul-mouthed “Wouldn’t you love to see one of these NFL owners, when somebody disrespects the flag, to say ‘get that son of a b**** off the field right now. Out! He’s fired.” Now the controversy is increasing. Surely, not only have people a right to protest, indeed they are showing a greater love for their country by trying to make it better. Where would America be without such heroes as Martin Luther King, who stood up for his people, stood up against injustice and gave his life for his cause. A picture went viral this week of MLK, all those years ago, going down on one knee in prayer. His daughter, Bernice King put it well : “The real shame and disrespect is that, decades after the first photo, racism STILL kills people and corrupts system.” It seems to me to be about more than just a flag. Trump’s presidency seems to have emboldened white supremacists, whose idea of “making America great again” is to return to the good old days when blacks knew their place, which of course to say the least is subservient to them; back to the 1960s and even further. I read that in the first month after Trump was elected in one area in the south of the USA, there were over a thousand incidents described as “hate in America.” They included swastikas in schools, racist taunts, anti-Semitic slogans, pelting Muslim with coins and attacks on the LGBT community. And what a pathetic response by Trump to the events in Charlottesville, when torch-bearing neo-Nazis hit the streets. Virginia Senator Tim Kaine responded to the awful violence and hatred by saying: “This is not who we are.” But many have responded by suggesting, maybe we are. Maybe racism, bigotry and abuse are part of our DNA and we need to be taught to love. What on earth is it that makes us hate and demean people just because the colour of their skin? Of course, that wouldn’t happen here. Pah, would it not? I know of young footballers in this area disgustingly treated because of their colour, and some coaches laugh at their players who do it. And the abuse of people different to the so-called norm was highlighted at the week-end when a centre in Belfast was daubed with “No blacks” and “No Muslims.” So, it’s not “only in America”, it’s in all our hearts. It’s a shame and a blot on mankind. And if we don’t root out bitterness and teach people to respect each other, the division will continue for the hundreds of years the way it does in the Land of the Free.',
