    url: 'http://www.wnem.com/story/36514970/coates-promotes-new-book-we-were-eight-years-in-power',
    host: 'wnem.com',
    text: 'Coates promotes new book \'We Were Eight Years in Power\' Posted: By HILLEL ITALIEAP National Writer \nNEW YORK (AP) - Ta-Nehisi (tah neh-HAH\'-see) Coates has personal and political thoughts to share on publication day for his new book. \nThe award-winning author and journalist spoke before hundreds of people gathered Tuesday night in New York City. \nHe was interviewed on stage at the New School by his editor, Chris Jackson, as he discussed "We Were Eight Years in Power: An American Tragedy." The book includes essays Coates wrote during President Barack Obama\'s administration and commentary by the author as he takes in the election of Donald Trump last fall. \n"We Were Eight Years in Power" is already in the top five on Amazon.com\'s best-seller list. It includes a new and widely discussed essay, "The First White President," in which Coates writes about Trump\'s race being an essential factor in his surprise victory.',
