    host: 'chron.com',
    text: 'Uber curbs ex-CEO\'s power, sells big stake to SoftBank Michael Liedtke and Tom Krisher, Ap Business Writers Updated 7:46 pm, Tuesday, October 3, 2017 \nSAN FRANCISCO (AP) — Uber is curbing the power of former CEO and co-founder Travis Kalanick and taking on Japan\'s SoftBank Group as a major new investor as the ride-hailing service tries to recover from internal strife and a myriad of legal headaches. \nThe changes adopted unanimously Tuesday by Uber\'s 11-member board strip Kalanick and other early investors of the extra voting power they were originally granted to control the privately held company\'s direction. \nThe Associated Press learned of the details from two people briefed on the board vote. They asked not to be identified because the board\'s decisions are considered confidential. \nThe same two people also told the AP that SoftBank will invest more than $10 billion in Uber and get two seats on expanded board that will consist of 17 directors. More Business News',
