    host: 'informnny.com',
    text: 'President Trump travels to hurricane-ravaged Puerto Rico By: JOSEPH KACHNIC Posted: Oct 03, 2017 10:01 AM EDT Updated: Oct 03, 2017 10:01 AM EDT Copyright 2017 The Associated Press. All rights reserved. This material may not be published, broadcast, rewritten or redistributed. Copyright 2017 The Associated Press. All rights reserved. This material may not be published, broadcast, rewritten or redistributed. President Donald Trump will travel to Puerto Rico today -- two weeks after Hurricane Maria first struck the island. The president said he will meet with FEMA and military officials, first responders, and the people of Puerto Rico. Additionally, he said the governor of the U.S. Virgin Islands will “probably” travel to Puerto Rico to meet with him. Trump will be accompanied on the trip by first lady Melania Trump . The president’s trip comes amid some criticism over the federal government’s response to the island twice hit by a hurricane in the past month. The president has repeatedly defended the federal response. “It’s been amazing what’s been done in a very short period of time on Puerto Rico,” the president said in the Oval Office Monday. It’s unclear whether the president will meet with San Juan Mayor Carmen Yulin Cruz, whom the president accused of “poor leadership” in a barrage of tweets over the weekend.',
