    url: 'http://www.apnewsarchive.com/2017/The-U-S-Department-of-Justice-sued-Loveland-based-Crop-Production-Services-claiming-the-company-rejected-to-hire-at-least-three-workers-because-they-are-U-S-citizens-and-instead-hired/id-009ffb17417f404ab8ea42c1313c9f12',
    host: 'apnewsarchive.com',
    text: 'US agency sues Colorado-based Crop Production Services Oct 3, 2017 0 \nLOVELAND, Colo. (AP) — The U.S. Department of Justice sued Loveland-based Crop Production Services, claiming the company refused to hire at least three workers because they are U.S. citizens and instead hired foreign temporary workers. \nThe Reporter-Herald reports ( http://bit.ly/2fHv1XM ) the lawsuit, filed Thursday, alleges Crop Production Services violated the Immigration and Nationality Act by showing preference to noncitizens under the H-2A visa program. \nThe Justice Department\'s complaint says Crop Production Services discriminated against at least three U.S. citizens who were applying for jobs last year as seasonal technicians at the company\'s rice-breeding facility in El Campo, Texas. \nIn an email Monday, Crop Production Services said it couldn\'t comment. \n——— \nInformation from: Loveland Daily Reporter-Herald, http://www.reporterherald.com/ \nCopyright 2017 The Associated Press. All rights reserved. This material may not be published, broadcast, rewritten or redistributed. Tags',
