    crawl_date: '2017-10-04T01:59:51Z',
    url: 'http://www.ocregister.com/2017/10/03/i-felt-very-helpless-veteran-riverside-officer-says-after-witnessing-las-vegas-shooting/',
    host: 'ocregister.com',
    text: 'Orange County News ‘I felt very helpless,’ veteran Riverside officer says after witnessing Las Vegas shooting   Shea and Jennifer McMahon, of Riverside, pose at the Route 91 Harvest Festival in Las Vegas. They later had to run for their lives as Stephen Paddock fired on the crowd from the Mandalay Bay hotel on Oct. 1, 2017. (Courtesy of Shea McMahon) By Brian Rokos | brokos@scng.com | The Press-Enterprise October 3, 2017 at 7:01 pm Shea McMahon, a Riverside police officer, usually runs to danger while others scramble in the opposite direction.\nBut the massacre in Las Vegas during the Route 91 Harvest Festival on Sunday, Oct. 1, was anything but usual.\nSo McMahon, 41, who attended the concert with his wife, Jennifer, 39, and brother-in-law and sister-in-law, made sure they all ran for cover as he watched shooting victims drop around them. None of the four was among the more than 500 injured or killed.\n“I felt very helpless,” McMahon, a 16-year veteran of law enforcement, said Tuesday, Oct. 3, as he returned to patrol. McMahon said he thought talking about his ordeal would make him feel better and that climbing back into his familiar black-and-white would make him feel comfortable.\n“Normally, you’re in this job, and something happens, and you have the tools to fight back. Not knowing where the actual shooting was coming from, there was nothing I could fight back with,” said McMahon, who repeated the word “helpless” several times in the interview.\n“Maybe if I was there by myself, or with my buddies, it might have been different,” he said.\nInstead, his first instinct after hearing automatic gunfire was to throw himself on top of his wife after she went to the ground to protect herself. McMahon’s brother-in-law, a Riverside County sheriff’s deputy, did the same to shield his wife.\nAll four are country music fans and regularly attend the Stagecoach Festival in Indio and other concerts. Over the weekend, the couples were celebrating their wedding anniversaries.\nThey had places about 25 yards from the stage where Jason Aldean was performing when the shooting began.\nMcMahon didn’t cover his wife for long after the women in front of them and behind them had been shot.\n“I said ‘Somebody is shooting. We have to get out of here.’ If we were on the ground, we were sitting ducks,” McMahon said. “Seeing people getting shot in the leg and the back and the head, I was preparing to be shot like them.”\nAs they ran toward the exit, others continued to fall beside them. Some were trampled.\n“The noise was just deafening,” he said. “It felt like he was in the venue, chasing us down. It felt like we were being hunted.”\nThey ran to an apartment complex, where someone ushered them into a room. The couples called their families. The McMahons thought about their son, who turned 14 on Monday, and their daughter, 11.\nJennifer then   back of Shea’s shirt was stained with someone else’s dried blood.\n“We’re lucky to be alive,” Shea McMahon said. “It’s a miracle; the grace of God.”',
