    host: 'rssfeeds.13newsnow.com',
    text: 'Close Man charged in random attack on police officer in Va. Beach coffee shop Investigators say there had been no prior interaction between the suspect and officer, and the attack was unprovoked. Staff , WVEC 12:54 PM.   Antoine Omar Wynn CONNECT TWEET LINKEDIN GOOGLE+ PINTEREST \nVIRGINIA BEACH, Va. (WVEC) -- Police have charged Antoine Omar Wynn, 33, in connection with an attack on a police officer that happened this morning. \nIt happened at about 7:15 a.m. at the Bad Ass Coffee shop located at 619 18th Street. Investigators say a uniformed police sergeant was ordering a coffee when he was "aggressively approached" by Wynn. \nDue to the commotion Wynn was causing, the sergeant asked that the man step outside, at which time Wynn allegedly began pummeling the officer. \nOne employee jumped in to help the sergeant, while another called 911. \nWynn got up and fled the coffee shop, with the sergeant in pursuit. He was caught a short distance away. \nInvestigators say there had been no prior interaction between Wynn and officer, and the attack was unprovoked. \nThe sergeant was treated for minor injuries at the scene. Wynn was not hurt during the incident. \nWynn is charged with felony assault and battery of a law enforcement officer, destruction of property, disorderly conduct and providing false identity to a law enforcement officer. \nHe is being held at Virginia Beach Correctional Center without bond. \n© 2017 WVEC-TV',
