    host: 'insidenova.com',
    text: 'George Mason University student dies on campus Saturday School police warn campus dangerous hallucinogen may be linked Oct 1, 2017 0 A student at George Mason University has died in an incident Saturday that may have involved a hallucinogenic drug, according to police, and other students may have the same substance in their possession. Officers responded at 4:41 p.m. Saturday to the Potomac Heights Residence Hall. The Washington Post reports the student may have fallen from a fifth floor window . University Police Chief Carl Rowan did not specify the circumstances of the incident in a statement released Sunday morning. The student died from his injuries at an area hospital, he said. Foul play is not suspected. “If anyone has taken a hallucinogenic substance or is in possession of a hallucinogenic substance, please contact law enforcement immediately by dialing 911 or contact University Police at 703-993-2810,” Rowan noted in the statement. “The university maintains a medical amnesty program — if you have taken a hallucinogenic substance and you fear for your safety, please call Mason Police.” \nCounseling service have been made available to students closely impacted, Rowan noted, and they will be available for anyone who may wish to speak with a counselor. For more information, call 703-993-2380, or visit caps.gmu.edu. To reach an after hours counselor, students should call Mason Police at 993-2810. Tags',
