    url: 'https://www.cambridgenetwork.co.uk/news/businesses-support-challenge-fund-cambridge-cancer-scientists/',
    host: 'cambridgenetwork.co.uk',
    text: 'Call to businesses to support £100K challenge to fund Cambridge cancer scientists Call to businesses to support £100K challenge to fund Cambridge cancer scientists 4/10/2017 BUSINESSES in Cambridge are being urged to help beat cancer by supporting a ground-breaking research project that’s taking place in the city. \nScientists and doctors in Cambridge, who are funded by Cancer Research UK, are testing a revolutionary imaging technique at Addenbrooke’s that could show whether a cancer drug is working or not within a day or two of treatment starting. \nThis is exciting, innovative research that is expensive to carry out. That’s why Cancer Research UK and the Cambridge Independent are joining forces to set the city’s businesses a challenge – can we raise £100k in 12 months to fund this local research? \nThis is a chance for you and your employees to get behind something linked directly to cancer research in Cambridge. The lead researchers on the trial are Professor Kevin Brindle and Dr Ferdia Gallagher. Since 2013, they have been working together to develop a new type of MRI scan that can be used to spot when cancers first start responding to treatment. \nProfessor Brindle and Dr Gallagher were the first in Europe to test this ground-breaking technique in patients, and they are continuing their work at Addenbrooke’s Hospital right now. Their imaging research* involves patients who are being treated for a wide range of cancer types. \nThe money raised through this fundraising campaign will be used to fund a research project which aims to determine if a breast cancer drug is working for patients. \nIt’s thought the drug will work for some patients, but not others. By using this new imaging technique, the research group aims to determine as quickly as possible which patients it does work for. \nThe funding would cover the cost of materials, research in the lab and help to develop this revolutionary imaging technique. \nHeidi Connell, Cancer Research UK’s Senior Local Fundraising Manager, said: “This is a one off opportunity to support a research project which could have a big impact on those around you and on future generations. \n“We are very excited to have this research going on in Cambridge. If it’s successful, this new imaging technique could change how we treat patients in the future. \n“Improvements and developments in technology like this have the potential to give each cancer patient a better chance of surviving their disease. It’s this type of intelligent, innovative thinking that’s going to help us accelerate progress and beat cancer sooner. So please get behind the appeal and support this local research.” \nRight now, doctors use the size of a tumour to determine if a treatment is working or not. If it stops growing or starts shrinking, then treatment’s classified as working. If the tumour doesn’t shrink or stop growing, treatment’s classed as having failed. \nBut Professor Brindle and Dr Gallagher don’t believe this is the most accurate or fastest way of monitoring if treatment is working. Instead, they believe measuring the chemical activity of tumour cells would be better. \nThis is because cancer cells that are responding to treatment shut down and die quickly, meaning their chemical activity is lower than cells that aren’t responding to treatment. \nCurrently, patients must wait for weeks or months to find out if a treatment is working or not. But doctors believe this wait is too long. \nThe hope is that the new technique will speed up this process and ultimately, be used to help more people with all types of cancer get the treatment that’s right for them faster. \nIt could also be used to identify which patients should stop taking drugs that aren’t working for them, allowing them to try different ones and receive the best treatment for their cancer sooner. \nProfessor Kevin Brindle, co-lead based at the Cancer Research UK Cambridge Institute, said: “We’re very excited to be the first group to test this technique in patients and we hope that it will soon improve treatment – and put an end to giving patients treatments that don’t work for them, along with unpleasant side effects that accompany them. Each person’s cancer is different and this technique could help us tailor a patient’s treatment faster than ever.” \nDr Ferdia Gallagher, co-lead also funded by Cancer Research UK and based at the Department of Radiology at the University of Cambridge, said: “It’s fantastic that we are able to try this technique in patients. We hope this will progress the way cancer treatment is given and make therapy more effective for patients in the future. This new technique could potentially mean that doctors will find out much more quickly if a treatment is working for their patient instead of waiting to see if a tumour shrinks.” \nFor more information on how to get involved and how your business will benefit, please email: \nTo support the trial visit: www.justgiving.com/fundraising/cambridgeresearchproject \nAbout Cancer Research UK Cambridge Institute \nThe Cambridge Institute turns 10 this year. Here are some of the highlights from the first decade: Found that breast cancer is not one, but at least 10 different diseases in the METABRIC study. Pioneered the use of blood tests to get important information about cancer Started 20 clinical trials and has been involved in at least 20 others Teamed up with labs from as far afield as Australia and Japan in world-wide cancer-beating collaborations. Looked to outer space to beat cancer. They’ve been working with astronomers to improve our microscopes. Trained 142 junior scientists – the next generation of world-leading researchers. Published 1200 scientific papers \nCambridge Institute is a site of world-renowned scientific excellence and houses 420 staff from around 32 countries. \nwww.cruk.cam.ac.uk \n* The project is being led jointly by Professor Kevin Brindle (Cancer Research UK Cambridge Institute) and Dr Ferdia Gallagher (Department of Radiology) and involves a large number of co-investigators and collaborators in the University of Cambridge and at Addenbrooke’s hospital including Professor David Lomas (Radiology), Professor Ian Wilkinson (Department of Medicine), Dr Bristi Basu (Oncology) and Mrs Anita Chhabra (Pharmacy). \nThe facility and clinical trials are funded and supported by the Wellcome Trust, Cancer Research UK, Addenbrooke’s Charitable Trust, the Cambridge Cancer Centre, Cambridge University Hospitals NHS Foundation Trust, GE Healthcare and the University of Cambridge. \nThe research is also funded by the Wellcome Trust strategic award \nThe Cancer Research UK Cambridge Institute (CRUK-CI) aims to bring the scientific strengths of Cambridge to bear on practical questions of cancer diagnosis, treatment and prevention.',
